export default styles = {
  wrapper: {
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center"
  },

  name: {
    color: "#fff",
    fontSize: 12,
    textTransform: "uppercase"
  },

  avatar: {
      display: 'block',
      width: 30,
      height: 30,
      borderRadius: '50%',
      backgroundColor: '#fff'
  }
}
